import { Component } from "react";
import { createStore } from "redux"



class UserTask extends Component {
    constructor(props)
    {
        super(props)
        this.state={
            a : ""
        }
    }



    render() {
        //Actions
        const Vadivelu = () => ({ type: "VADIVELU" })
        const Goundamani = () => ({ type: "GOUNDAMANI" })

        //Reducer
        const ComedyReducer = (state, actions) => {
            switch (actions.type) {
                case "VADIVELU":
                    return state = "Enga thaliku dhilla pathia !!"
                    break
                case "GOUNDAMANI":
                    return state = "Ada paradesi nayee !!"
                    break
                default:
                    return state = "Enna onnulla ??"
            }
        }

        let store = createStore(ComedyReducer)
        store.subscribe(() => {
            console.log(store.getState())
        })
        store.dispatch(Vadivelu())

        this.setState(
            {
                a : "Hello"
            }
        )

        return (
            <div>
                <h1>Hello</h1>
            </div>
        )
    }
}

export default UserTask
